  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Home Health Agency PUF contains information
  on utilization, payment (Medicare payment and standard payment), and submitted charges
  organized by CMS Certification Number (6-digit provider identification number),
  Home Health Resource Group (HHRG), and state of service. This PUF is based on information
  from CMSs Chronic Conditions Data Warehouse (CCW) data files. The data in the Home
  Health Agency PUF covers calendar year 2013 and contains 100 percent final-action
  (i.e., all claim adjustments have been resolved) home health agency institutional
  claims for the Medicare fee-for-service (FFS) population.</p>n\",\n\t\"license_title\":
